        <table class="table table-striped">
            <thead> 
                <th>ID</th> 
                <th >pasNumber</th>
                <th >fore names</th>
                <th >sur name</th>
                <th>date Of Birth</th>
                <th>sex Code</th>
                <th>home TelephoneNumber</th>
                <th>nok Name</th>
                <th>nok Relation ship Code</th>
                <th>nok Address Line1</th>
                <th>nok Address Line2</th>
                <th>nok Address Line3</th>
                <th>nok Address Line4</th>
                <th>nok Postcode</th>
                <th>gp Code</th>
                <th>gp Surname</th>
                <th>gp Initials</th>
                <th>gp Phone</th>
                <th></th>
                <th></th>
            </thead>
