                <td>{{i.id}}</td>
                <td>{{i.pasNumber}}</td>
                <td>{{i.forenames}}</td>
                <td>{{i.surname}}</td>
                <td>{{i.dateOfBirth | date}}</td>
                <td>{{i.sexCode}}</td>
                <td>{{i.homeTelephoneNumber}}</td>
                <td>{{i.nokName}}</td>
                <td>{{i.nokRelationshipCode}}</td>
                <td>{{i.nokAddressLine1}}</td>
                <td>{{i.nokAddressLine2}}</td>
                <td>{{i.nokAddressLine3}}</td>
                <td>{{i.nokAddressLine4}}</td>
                <td>{{i.nokPostcode}}</td>
                <td>{{i.gpCode}}</td>
                <td>{{i.gpSurname}}</td>
                <td>{{i.gpInitials}}</td>
                <td>{{i.gpPhone}}</td>
                    <td>
                        <span class="fa fa-edit" aria-hidden="true" (click)="edit(i)"><br><small>Edit</small></span>
